import gql from 'graphql-tag';

const SINGLE_ORDER_QUERY = gql`
    query SINGLE_ORDER_QUERY($id: ID!) {
        order: Order(where: { id: $id })
    }
`;

export default function SingleOrderPage({ query }) {
    return <div>Hey Order page { query.id }</div>;
}
